const HomePage = () => {
return (
    <div className=" row Cont ">
    <div className="  mt-4 col-md-6 text-center ">
    <p className="fonts" style={{fontFamily:"'Satisfy', cursive"}}>I'm a Web,   MERN, React Developer</p>
    </div>


    <div className="col-md-6 text-center">
    <image src="/images/Componentblack.png" alt="no image to preview" class="rounded-circle  image "/>
    <div className="text-center mt-3">
    <button type="button" class="btn btn-secondary bg-dark">Download Resume</button>
    </div>
    </div>
    
    </div>
)


};

export default HomePage;
